{'active': 'Yes', 'temporarily_closed': None, 'location_id': '319', 'pharmacy': None, 'community_lab': None, 'assessment_centre': 'Yes', 'location_name': 'COVID-19 Care and Testing Centre –  Ray Friel', 'location_name_fr': None, 'operated_by': 'Hopital Montfort', 'operated_by_fr': None, 'city': 'Orleans ', 'address': '1585 Tenth Line Road', 'address_fr': None, 'postal_code': 'K1E 3E8', 'province': 'ON', 'latitude': '45.472165', 'longitude': '-75.491907', 'phu_id': None, 'PHU': 'Ottawa Public Health', 'PHU_fr': None, 'phone': '613-288-5353', 'website': 'https://ottawa.ca/en/recreation-and-parks/recreation-facilities/facility-listing/ray-friel-recreation-complex', 'email': None, 'monday': '08:00-18:00', 'tuesday': '08:00-18:00', 'wednesday': '08:00-18:00', 'thursday': '08:00-18:00', 'friday': '08:00-18:00', 'saturday': '08:00-18:00', 'sunday': '08:00-18:00', 'after_hours': None, 'appointments': 'Yes', 'online_appointments': 'https://registration-mom.mychamp.ca/Live/Montfort/Booking/Account/BookRegister', 'phone_appointments': None, 'walk_ins': 'No', 'symptomatic': 'Yes', 'drive_through': 'No', 'general_population': None, 'children_under_2': None, 'age_threshold': None, 'weeks_pregnant': None, 'french_language_services': None, 'accessible': None, 'asl_interpretation': None, 'first_nations': None, 'free_parking': None, 'paid_parking': None, 'public_transit': None, 'additional_information': 'The COVID-19 Care Clinics are out-of-hospital clinics where people will be assessed by a healthcare provider, tested, and treated for respiratory illness, if required. The clinics are run by local hospitals in partnership with the City of Ottawa, primary care physicians, community pediatricians, the regional COVID-19 planning team and Ottawa Public Health. They are equipped to do basic diagnostic tests, such as chest X-rays and lab tests.   The Care Clinic will help people get treatment they require for respiratory illness, while helping keep Emergency Departments available for other emergencies.

You should come to the COVID-19 Care Clinics if:
You have escalating symptoms of respiratory illness, including a fever or worsening cough and flu-like symptoms, and are in need of medical attention.  For general information, please call 613-580-2400 or 1-866-261-9799', 'additional_information_fr': None}
